import React, {useEffect} from 'react';
import { _ViewCans } from '../../stl-cmp';
import search from '../../img/search.svg';
import CardCan from './CardCan'
import { connect } from 'react-redux';
import {getCans, viewCan, getPages, activePage} from '../../redux/actions/actions'

const ViewCans = ({cans, can, pagination, pag, temp, filter ,getCans, viewCan, getPages, activePage}) => {

    useEffect(()=>{
        (async function (){
            return (await getCans());

        })()
    }, [getCans])

    useEffect(() => {
        getPages()
        activePage(0)
    }, [cans])


	return (
		<_ViewCans>
			<form>
				<label>
					<p>Busca un Can</p>
					<div>
						<input type="text" />
						<button>
							<object data={search} type="image/svg+xml" />
						</button>
					</div>
				</label>
			</form>
            <div className="Views">
                {
                    pag?.length!==0?

                        pag.map((e)=>{
                            return(
                                <CardCan
                                key={`item-${e.id.toString()}`}
                                id={e.id}
                                name={e.name}
                                picture={e.picture} 
                                temps={e.temps} 
                                weight={e.weight} 
                                height={e.height} 
                                yearsOfLife={e.yearsOfLife}
                                />
                            )
                        })

                    :
                    <p key='nothing' >no hay perros para mostrar.</p>

                }
            </div>
		</_ViewCans>
	);
};

const mapStateToProps=(state)=>{
    return {
    ...state
    }
}



export default connect(mapStateToProps, {getCans, viewCan, getPages, activePage} )(ViewCans);
